uld not be activated.'=>'Не удалось активировать Font Awesome.','Font Awesome requires a PHP Version of at least %1$s. Your current version of PHP is %2$s.'=>'Для Font Awesome требуется версия PHP не ниже %1$s. Ваша текущая версия PHP — %2$s.','Unable To Load Font Awesome Plugin.'=>'Не удалось загрузить плагин Font Awesome.','We were not able to save conflict detection data to your WordPress database.'=>'Нам не удалось сохранить данные об обнаружении конфликтов в вашей базе данных WordPress.','Inconceivable! Somehow the conflict detection information got garbled into something we can\'t understand.'=>'Невероятно! Каким-то образом информация об обнаружении конфликтов была искажена во что-то, что мы не можем понять.','When trying to load Font Awesome, the plugin\'s configuration was invalid. Try deactivating, uninstalling, and re-activating the Font Awesome plugin.'=>'При попытке загрузить Font Awesome конфигурация плагина была недействительной. Попробуйте деактивировать, удалить и повторно активировать плагин Font Awesome.','Something went wrong when we tried to store the list of available Font Awesome versions in your WordPress database.'=>'Что-то пошло не так, когда мы попытались сохранить список доступных версий Font Awesome в вашей базе данных WordPress.','An unexpected response was received from the Font Awesome API server.'=>'От сервера Font Awesome API получен неожиданный ответ.','Your WordPress server failed trying to send a request to the Font Awesome API server.'=>'Ваш сервер WordPress не смог отправить запрос на сервер Font Awesome API.','A theme or plugin registered with Font Awesome threw an exception.'=>'Тема или плагин, зарегистрированные в Font Awesome, вызвали исключение.','Whoops! You found a corner case here. Older Version Compatibility for our webfont technology was not introduced until Font Awesome 5.1.0. Try using a newer version, disabling version 4 compatibility, or switch to SVG.'=>'Упс! Вы нашли здесь угловой ящик. Совместимость со старыми в